import React from "react";
import unsplash from "../../../helpers/unsplash";

const Confirmation= async(props)=>{
    return(
        <div className="box">
            <div className="columns">
            </div>
            <div className="container">
                <button className="button"><a href="/calc">Yep, that's right!</a></button>
                <button className="button"><a href="/">No, I meant someplace else</a></button>
            </div>
        </div>
    )
}

export default Confirmation
